import React from 'react';
import './App.css';
import {BrowserRouter as Router} from 'react-router-dom'
import Home from './pages/index.js';
import { AuthProvider } from './components/Account';
import Status from './components/Status';

function App() {
  return (
    <Router>
      <AuthProvider>
        <Status/>
        <Home />
      </AuthProvider>
    </Router>
  );
}

export default App;
